import Document, { Html, Head, Main, NextScript } from 'next/document'
import Home from './Home'

class App extends Document {
  render() {
    return (
      <Html>
        <Head>
            <link rel="preconnect" href="https://fonts.gstatic.com"/>
            <link href="https://fonts.googleapis.com/css2?family=Nunito:ital,wght@0,300;0,400;0,900;1,300&display=swap" rel="stylesheet"/>
        </Head>
        <body>
            <Home />
        </body>
      </Html>
    )
  }
}

export default App
